import Cards from '../components/Cards';
import HeroSection from '../components/HeroSection';
import Footer from '../components/Footer';
import Navbar from './Navbar';

function Home() {
  return (
    <>
    <Navbar/>
    <HeroSection />
    <Cards />
    <Footer />
  </>
  )
}

export default Home
